//Footer block



const Footer = () => {
    return (
      <div>
      <div className="row">
        <div className="col-md-12">

        <footer className="bg-dark text-white text-center py-3 fixed-bottom">
        <p className="mb-0 footertext">© {new Date().getFullYear()} All rights reserved.</p>
      </footer>
        </div>
      </div>

      </div>
    );
  };
  
  export default Footer;
